function setupNavBar(){const e=Array.prototype.slice.call(document.querySelectorAll(".navbar-burger"),0);e.length>0&&e.forEach(e=>{e.addEventListener("click",()=>{const t=e.dataset.target,n=document.getElementById(t);e.classList.toggle("is-active"),n.classList.toggle("is-active")})})}function getStarted(){const e=document.getElementById("get-started"),t=document.getElementById("wallet"),n=document.getElementById("get-wallet");t.addEventListener("click",()=>{e.classList.add("hidden"),n.classList.remove("hidden")})}document.addEventListener("DOMContentLoaded",()=>{setupNavBar(),getStarted()});